import { useSelector } from 'react-redux';
import Cell from "./cell";

export default function Cells(){

    const [color1, color2] = useSelector(store => store.chess.colors)

    return (
        Array.from({length: 64}, (_,i)=>
            <Cell
                x={i % 8}
                y={Math.floor(i/8)}
                key={i}/>
        )
    )
}
